import React from 'react';
import ChatBot from 'react-simple-chatbot';
const config ={
    width: "400px",
    height: "500px",
    floating: true,
  };
const Chatbot = () => {
    return (
        <div>
           <ChatBot
           steps={[
               {
                   id:'intro',
                   message:'Hello Recruiter. Thank You for Visitng my portfolio.',
                   end:true,
               },
           ]}
           {...config}
           /> 
        </div>
    )
}
export default Chatbot
